/** Free the parser resources
 */
 static void
 CParserFree(pCParser ctx)
 {
    /* Free any scope memory
     */
    /* ruleAttributeScope(scope)
     */
    ctx->pCParser_translation_unitStack->free(ctx->pCParser_translation_unitStack);
    /* ruleAttributeScope(scope)
     */
    ctx->pCParser_declarationStack->free(ctx->pCParser_declarationStack);
    /* ruleAttributeScope(scope)
     */
    ctx->pCParser_init_declaratorStack->free(ctx->pCParser_init_declaratorStack);
    /* ruleAttributeScope(scope)
     */
    ctx->pCParser_initializerStack->free(ctx->pCParser_initializerStack);

    
        
    ctx->pParser->free(ctx->pParser);
    ANTLR3_FREE(ctx);

    /* Everything is released, so we can return
     */
    return;
 }
 
